import styled from "styled-components"
import About from "./Career/About"
import Position from "./Career/Position"


const CareerContainer = styled.div`
    width : 45rem;
    background-color : blue;
    padding : 20px;
`


function MyCareer(){
    return(
        <CareerContainer>
                <About />
                <Position />
        </CareerContainer>
    )
}

export default MyCareer
